import TailFooter from "../comm/TailFooter"
import FoodList from "./FoodList"
import { BrowserRouter, Route, Routes } from "react-router-dom"
import Login from "./Login"
import Mycalorie from "./Mycalorie"
import Signup from "./Signup"
import Profile from "./Profile"
import { NavLogout } from "../comm/NavLogout"
import { NavLogin } from "../comm/NavLogin"

const jwt = sessionStorage.getItem("jwt")
const authen = () => {
    alert("로그인하세요")
    window.location.replace("/login")
}

const logout = () => {
    if (window.confirm("로그아웃하시겠습니까?")) {
        sessionStorage.removeItem("jwt")
        sessionStorage.removeItem("username")
        window.location.replace("/")
    } else {
    }
}


const Main = () => {
    return (
        <BrowserRouter>
            <div className="flex flex-col w-full mx-auto h-screen">
                <nav>
                {jwt === null 
                ?<NavLogout/>
                :<NavLogin/>
                }
                </nav>
                <div className='grow flex flex-col'>
                    <Routes>
                        <Route path="/mycalorie" element={<Mycalorie/>}/>
                        <Route path="/login" element={<Login/>}/>
                        <Route path="/signup" element={<Signup/>}/>
                        <Route path="/profile" element={<Profile/>}/>
                    </Routes>
                </div>
                <TailFooter />
            </div>
        </BrowserRouter>
    )
}

export default Main
